import React from "react";

const Contact = ({ contact }) => (
  <div>
    <h2>{contact.firstName}</h2>
    <h3>{contact.lastName}</h3>
    <p>전화번호: {contact.phone}</p>
    <p>이메일: {contact.email}</p>
  </div>
);

export default Contact;
